const Navbar = () => {
  return (
  <nav className=" flex items-center justify-between ">
    <div className="flex items-center">
        <img  src={logo1} alt="logo" />
    </div>
    <div className="m-8 flex items-center justify-center gap-4 text-2xl ">
      <a href="#"></a>
      <a href="#"></a>
      <a href="#"></a>
    </div>
  </nav>
  );
}

export default Navbar;
